import React from "react";
import FooterLink from "./FooteLink"

const FooterCustomerAreaLinks = () => {

    return(
        <>
            <FooterLink 
                        name={"My Account"}
                        href={"#"}
                    />
                    <FooterLink 
                        name={"Orders"}
                        href={"#"}
                    />
                    <FooterLink 
                        name={"Tracking List"}
                        href={"#"}
                    />
                    <FooterLink 
                        name={"Terms"}
                        href={"#"}
                    />
                    <FooterLink 
                        name={"Privacy Policy"}
                        href={"#"}
                    />
                    <FooterLink 
                        name={"FAQ"}
                        href={"#"}
                    />
        </>
    )
}

export default FooterCustomerAreaLinks;
